import React from "react";
import { Link } from "react-router-dom/cjs/react-router-dom.min";


const Table5 = () => {
  return (
    <>
    <Link to="/reports">
    <button className="btn btn-secondary mx-2">
        Back
    </button>
</Link>
<br/>
<br/>
<div>
    <center>
        <h2>  Constituency won with margin Ranges</h2>
    </center>
</div>
</>
  );
};

export default Table5;
